    <div class="sketchfab-embed-wrapper  model_3d"> 
    <iframe title="SARS-CoV-2 (COVID-19)"
    frameborder="0" allowfullscreen mozallowfullscreen="true" 
    webkitallowfullscreen="true" allow="autoplay; 
    fullscreen; xr-spatial-tracking" xr-spatial-tracking execution-while-out-of-viewport execution-while-not-rendered web-share src="https://sketchfab.com/models/1533d2519b084a1580ddba0d3c5a3aff/embed?autostart=1&preload=1&ui_animations=0&ui_infos=0&ui_stop=0&ui_inspector=0&ui_ar=0&ui_help=0&ui_settings=0&ui_vr=0&ui_fullscreen=0&ui_annotations=0"> </iframe> 
